// components/Home.js

import { Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <Link to="/product/insert"><button>Insert Product</button></Link>
      <Link to="/product/view"><button>View Products</button></Link>
      <Link to="/product/update"><button>Update Product</button></Link>
      <Link to="/product/delete"><button>Delete Product</button></Link>
    </div>
  );
}

export default Home;
